import React from 'react';

let Todo_data = [
  "顔を洗う",
  "朝ごはんを食べる",
  "歯磨きをする",
];

export const Todo_list = (Todo_data) => {
  return(
    <div>
      {
        Todo_data.map((todo, i) => {
          return (
            <div key={i}>{todo}</div>
          )
        })
      }

    </div>
  )
}
